.toolbar {
  display: flex;
  justify-content: space-between;
  width: 100%;
  padding: 8px 0;
  border-width: 1px;
  border-style: solid;
  overflow-x: auto;
  overflow-y: hidden;
}
.toolbar_small {
  padding: 5px 0;
}
.toolbar_mini {
  padding: 3px 0;
}
.toolbar_zero {
  padding: 0;
}
.left, .right {
  display: flex;
  white-space: nowrap;
  flex-shrink: 0;
  align-items: center;
}
.left > * {
  float: left;
  margin-left: 8px;
}
.left > *:last-child, .right > * {
  margin-right: 8px;
}

.left_small > * {
  margin-left: 5px;
}
.left_small > *:last-child, .right_small > * {
  margin-right: 5px;
}

.left_mini > * {
  margin-left: 3px;
}
.left_mini > *:last-child, .right_mini > * {
  margin-right: 3px;
}

.left_zero > * {
  margin-left: 0;
}
.left_zero > *:last-child, .right_zero > * {
  margin-right: 0;
}

/* 禁止操作 */
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60);
  cursor: not-allowed;
}
